import './userdetails.css';
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const UserTable = () => {
    const [users, setUsers] = useState([]);
    const [error, setError] = useState('');

    useEffect(() => {
        axios.get('http://localhost:3003/user/getUser')
            .then(response => setUsers(response.data))
            .catch(error => {
                console.error('Error fetching users:', error);
                setError('An error occurred while fetching users. Please try again later.');
            });
    }, []);

    return (
       <>
            <div className="navigation">
                <ul>
                    <li>
                        <a href="#">
                            <span className="icon"></span>
                            <div className="title-3" style={{ fontSize: '50px' }}>Rare Fairy</div>
                        </a>
                    </li>
                    <li>
                        <Link to="/Home">
                            <span className="icon"><ion-icon name="home-outline"></ion-icon></span>
                            <div className="title-2">Dashboards</div>
                        </Link>
                    </li>
                    <li>
                        <Link to="/Userprofile">
                            <span className="icon"><ion-icon name="people-outline"></ion-icon></span>
                            <div className="title-2">Users</div>
                        </Link>
                    </li>
                    <li>
                        <Link to="/product">
                            <span className="icon"><ion-icon name="chatbubble-outline"></ion-icon></span>
                            <div className="title-2">Products</div>
                        </Link>
                    </li>
                    <li>
                        <Link to="/payment">
                            <span className="icon"><ion-icon name="wallet-outline"></ion-icon></span>
                            <div className="title-2">Payment</div>
                        </Link>
                    </li>
                </ul>
            </div>

            <div className="container-box">
                {error ? (
                    <div className="error">Error: {error}</div>
                ) : (
                    <table>
                        <thead>
                            <tr>
                                <th>Name</th>
                                <th>Email</th>
                                <th>Edit</th>
                                <th>Delete</th>
                            </tr>
                        </thead>
                        <tbody>
                            {users.map(user => (
                                <tr key={user._id}>
                                    <td>{user.name}</td>
                                    <td>{user.email}</td>
                                    <td>
                                        <button className='edit' type='button'>Edit</button>
                                        <button className='delete' type='button'>Delete</button>
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                )}
            </div>
            </>

    );
};

export default UserTable;
